com.google.gson.stream.JsonReader.javadoc:
* Reads a JSON (<a href="http://www.ietf.org/rfc/rfc7159.txt">RFC 7159</a>)
* encoded value as a stream of tokens. This stream includes both literal
* values (strings, numbers, booleans, and nulls) as well as the begin and
* end delimiters of objects and arrays. The tokens are traversed in
* depth-first order, the same order that they appear in the JSON document.
* Within JSON objects, name/value pairs are represented by a single token.
*
* <h2>Parsing JSON</h2>
* To create a recursive descent parser for your own JSON streams, first create
* an entry point method that creates a {@code JsonReader}.
*
* <p>Next, create handler methods for each structure in your JSON text. You'll
* need a method for each object type and for each array type.
* <ul>
*   <li>Within <strong>array handling</strong> methods, first call {@link
*       #beginArray} to consume the array's opening bracket. Then create a
*       while loop that accumulates values, terminating when {@link #hasNext}
*       is false. Finally, read the array's closing bracket by calling {@link
*       #endArray}.
*   <li>Within <strong>object handling</strong> methods, first call {@link
*       #beginObject} to consume the object's opening brace. Then create a
*       while loop that assigns values to local variables based on their name.
*       This loop should terminate when {@link #hasNext} is false. Finally,
*       read the object's closing brace by calling {@link #endObject}.
* </ul>
* <p>When a nested object or array is encountered, delegate to the
* corresponding handler method.
*
* <p>When an unknown name is encountered, strict parsers should fail with an
* exception. Lenient parsers should call {@link #skipValue()} to recursively
* skip the value's nested tokens, which may otherwise conflict.
*
* <p>If a value may be null, you should first check using {@link #peek()}.
* Null literals can be consumed using either {@link #nextNull()} or {@link
* #skipValue()}.
*
* <h2>Example</h2>
* Suppose we'd like to parse a stream of messages such as the following: <pre> {@code
* [
*   {
*     "id": 912345678901,
*     "text": "How do I read a JSON stream in Java?",
*     "geo": null,
*     "user": {
*       "name": "json_newb",
*       "followers_count": 41
*      }
*   },
*   {
*     "id": 912345678902,
*     "text": "@json_newb just use JsonReader!",
*     "geo": [50.454722, -104.606667],
*     "user": {
*       "name": "jesse",
*       "followers_count": 2
*     }
*   }
* ]}</pre>
* This code implements the parser for the above structure: <pre>   {@code
*
*   public List<Message> readJsonStream(InputStream in) throws IOException {
*     JsonReader reader = new JsonReader(new InputStreamReader(in, "UTF-8"));
*     try {
*       return readMessagesArray(reader);
*     } finally {
*       reader.close();
*     }
*   }
*
*   public List<Message> readMessagesArray(JsonReader reader) throws IOException {
*     List<Message> messages = new ArrayList<>();
*
*     reader.beginArray();
*     while (reader.hasNext()) {
*       messages.add(readMessage(reader));
*     }
*     reader.endArray();
*     return messages;
*   }
*
*   public Message readMessage(JsonReader reader) throws IOException {
*     long id = -1;
*     String text = null;
*     User user = null;
*     List<Double> geo = null;
*
*     reader.beginObject();
*     while (reader.hasNext()) {
*       String name = reader.nextName();
*       if (name.equals("id")) {
*         id = reader.nextLong();
*       } else if (name.equals("text")) {
*         text = reader.nextString();
*       } else if (name.equals("geo") && reader.peek() != JsonToken.NULL) {
*         geo = readDoublesArray(reader);
*       } else if (name.equals("user")) {
*         user = readUser(reader);
*       } else {
*         reader.skipValue();
*       }
*     }
*     reader.endObject();
*     return new Message(id, text, user, geo);
*   }
*
*   public List<Double> readDoublesArray(JsonReader reader) throws IOException {
*     List<Double> doubles = new ArrayList<>();
*
*     reader.beginArray();
*     while (reader.hasNext()) {
*       doubles.add(reader.nextDouble());
*     }
*     reader.endArray();
*     return doubles;
*   }
*
*   public User readUser(JsonReader reader) throws IOException {
*     String username = null;
*     int followersCount = -1;
*
*     reader.beginObject();
*     while (reader.hasNext()) {
*       String name = reader.nextName();
*       if (name.equals("name")) {
*         username = reader.nextString();
*       } else if (name.equals("followers_count")) {
*         followersCount = reader.nextInt();
*       } else {
*         reader.skipValue();
*       }
*     }
*     reader.endObject();
*     return new User(username, followersCount);
*   }}</pre>
*
* <h2>Number Handling</h2>
* This reader permits numeric values to be read as strings and string values to
* be read as numbers. For example, both elements of the JSON array {@code
* [1, "1"]} may be read using either {@link #nextInt} or {@link #nextString}.
* This behavior is intended to prevent lossy numeric conversions: double is
* JavaScript's only numeric type and very large values like {@code
* 9007199254740993} cannot be represented exactly on that platform. To minimize
* precision loss, extremely large values should be written and read as strings
* in JSON.
*
* <h2 id="nonexecuteprefix">Non-Execute Prefix</h2>
* Web servers that serve private data using JSON may be vulnerable to <a
* href="http://en.wikipedia.org/wiki/JSON#Cross-site_request_forgery">Cross-site
* request forgery</a> attacks. In such an attack, a malicious site gains access
* to a private JSON file by executing it with an HTML {@code <script>} tag.
*
* <p>Prefixing JSON files with <code>")]}'\n"</code> makes them non-executable
* by {@code <script>} tags, disarming the attack. Since the prefix is malformed
* JSON, strict parsing fails when it is encountered. This class permits the
* non-execute prefix when {@link #setLenient(boolean) lenient parsing} is
* enabled.
*
* <p>Each {@code JsonReader} may be used to read a single JSON stream. Instances
* of this class are not thread safe.
*
* @author Jesse Wilson
* @since 1.6

com.google.gson.stream.JsonWriter.javadoc:
* Writes a JSON (<a href="http://www.ietf.org/rfc/rfc7159.txt">RFC 7159</a>)
* encoded value to a stream, one token at a time. The stream includes both
* literal values (strings, numbers, booleans and nulls) as well as the begin
* and end delimiters of objects and arrays.
*
* <h2>Encoding JSON</h2>
* To encode your data as JSON, create a new {@code JsonWriter}. Call methods
* on the writer as you walk the structure's contents, nesting arrays and objects
* as necessary:
* <ul>
*   <li>To write <strong>arrays</strong>, first call {@link #beginArray()}.
*       Write each of the array's elements with the appropriate {@link #value}
*       methods or by nesting other arrays and objects. Finally close the array
*       using {@link #endArray()}.
*   <li>To write <strong>objects</strong>, first call {@link #beginObject()}.
*       Write each of the object's properties by alternating calls to
*       {@link #name} with the property's value. Write property values with the
*       appropriate {@link #value} method or by nesting other objects or arrays.
*       Finally close the object using {@link #endObject()}.
* </ul>
*
* <h2>Example</h2>
* Suppose we'd like to encode a stream of messages such as the following: <pre> {@code
* [
*   {
*     "id": 912345678901,
*     "text": "How do I stream JSON in Java?",
*     "geo": null,
*     "user": {
*       "name": "json_newb",
*       "followers_count": 41
*      }
*   },
*   {
*     "id": 912345678902,
*     "text": "@json_newb just use JsonWriter!",
*     "geo": [50.454722, -104.606667],
*     "user": {
*       "name": "jesse",
*       "followers_count": 2
*     }
*   }
* ]}</pre>
* This code encodes the above structure: <pre>   {@code
*   public void writeJsonStream(OutputStream out, List<Message> messages) throws IOException {
*     JsonWriter writer = new JsonWriter(new OutputStreamWriter(out, "UTF-8"));
*     writer.setIndent("    ");
*     writeMessagesArray(writer, messages);
*     writer.close();
*   }
*
*   public void writeMessagesArray(JsonWriter writer, List<Message> messages) throws IOException {
*     writer.beginArray();
*     for (Message message : messages) {
*       writeMessage(writer, message);
*     }
*     writer.endArray();
*   }
*
*   public void writeMessage(JsonWriter writer, Message message) throws IOException {
*     writer.beginObject();
*     writer.name("id").value(message.getId());
*     writer.name("text").value(message.getText());
*     if (message.getGeo() != null) {
*       writer.name("geo");
*       writeDoublesArray(writer, message.getGeo());
*     } else {
*       writer.name("geo").nullValue();
*     }
*     writer.name("user");
*     writeUser(writer, message.getUser());
*     writer.endObject();
*   }
*
*   public void writeUser(JsonWriter writer, User user) throws IOException {
*     writer.beginObject();
*     writer.name("name").value(user.getName());
*     writer.name("followers_count").value(user.getFollowersCount());
*     writer.endObject();
*   }
*
*   public void writeDoublesArray(JsonWriter writer, List<Double> doubles) throws IOException {
*     writer.beginArray();
*     for (Double value : doubles) {
*       writer.value(value);
*     }
*     writer.endArray();
*   }}</pre>
*
* <p>Each {@code JsonWriter} may be used to write a single JSON stream.
* Instances of this class are not thread safe. Calls that would result in a
* malformed JSON string will fail with an {@link IllegalStateException}.
*
* @author Jesse Wilson
* @since 1.6

nullSafe.javadoc:
* This wrapper method is used to make a type adapter null tolerant. In general, a
* type adapter is required to handle nulls in write and read methods. Here is how this
* is typically done:<br>
* <pre>   {@code
*
* Gson gson = new GsonBuilder().registerTypeAdapter(Foo.class,
*   new TypeAdapter<Foo>() {
*     public Foo read(JsonReader in) throws IOException {
*       if (in.peek() == JsonToken.NULL) {
*         in.nextNull();
*         return null;
*       }
*       // read a Foo from in and return it
*     }
*     public void write(JsonWriter out, Foo src) throws IOException {
*       if (src == null) {
*         out.nullValue();
*         return;
*       }
*       // write src as JSON to out
*     }
*   }).create();
* }</pre>
* You can avoid this boilerplate handling of nulls by wrapping your type adapter with
* this method. Here is how we will rewrite the above example:
* <pre>   {@code
*
* Gson gson = new GsonBuilder().registerTypeAdapter(Foo.class,
*   new TypeAdapter<Foo>() {
*     public Foo read(JsonReader in) throws IOException {
*       // read a Foo from in and return it
*     }
*     public void write(JsonWriter out, Foo src) throws IOException {
*       // write src as JSON to out
*     }
*   }.nullSafe()).create();
* }</pre>
* Note that we didn't need to check for nulls in our type adapter after we used nullSafe.

com.google.gson.TypeAdapterFactory.javadoc:
* Creates type adapters for set of related types. Type adapter factories are
* most useful when several types share similar structure in their JSON form.
*
* <h2>Examples</h2>
* <h3>Example: Converting enums to lowercase</h3>
* In this example, we implement a factory that creates type adapters for all
* enums. The type adapters will write enums in lowercase, despite the fact
* that they're defined in {@code CONSTANT_CASE} in the corresponding Java
* model: <pre>   {@code
*
*   public class LowercaseEnumTypeAdapterFactory implements TypeAdapterFactory {
*     public <T> TypeAdapter<T> create(Gson gson, TypeToken<T> type) {
*       Class<T> rawType = (Class<T>) type.getRawType();
*       if (!rawType.isEnum()) {
*         return null;
*       }
*
