*         final TypeAdapter<E> elementAdapter) {
*       return new TypeAdapter<Multiset<E>>() {
*         public void write(JsonWriter out, Multiset<E> value) throws IOException {
*           if (value == null) {
*             out.nullValue();
*             return;
*           }
